import React from "react";
import "./Nav.css";
import menuIcon from "./assets/burgerMenu.png";

const Nav = () => {
  return (
    <div className="nav__container">
      <div className="nav__burger">
        <img src={menuIcon} alt="burger menu icon" />
      </div>
    </div>
  );
};

export default Nav;
